export type countryIDs = (typeof countryList)[number]['id'];

export type countryItem = {
  id: countryIDs;
  shape: string;
  viewBox: string;
};

export default function getCountryShape(
  id: countryIDs | undefined
): countryItem | null {
  if (!id) return null;
  const uppercaseId = id.toUpperCase();
  return countryList.find((country) => country.id === uppercaseId) || null;
}
